import React from 'react'
import {BrowserRouter,Switch, Route} from 'react-router-dom'

//Pages
import notFound from '../pages/notFound'
import Listado from '../pages/listado'

function App(){
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path='/' component= ""/>
                <Route component = {notFound}/>
            </Switch>
        </BrowserRouter>
    )
}

export default App
